import React from "react";
import { Link } from "react-router-dom";
import "./Home.css";

export default function Home({ setPage }) {
  return (
    <>
      <h1>Home Page</h1>
      <div className="container">
        <div className="add-data">
          <Link to="/add" onClick={() => setPage("/add")}>
            Add Data
          </Link>
        </div>
        <div className="tag-data">
          <Link
            to="/tag"
            onClick={() => {
              setColor("white");
              setPage("/tag");
            }}
          >
            Tag Data
          </Link>
        </div>
      </div>
    </>
  );
}
